-- CAB
DROP TABLE cab CASCADE;
CREATE TABLE cab (
    id BIGINT NOT NULL,
    location INTEGER NOT NULL,
    name VARCHAR(255),
    status INTEGER NOT NULL,
    seats INTEGER NOT NULL,
    PRIMARY KEY (ID)
);
    select 0 as d union all 
    select 1 union all select 2 union all select 3 union all
    select 4 union all select 5 union all select 6 union all
    select 7 union all select 8 union all select 9        
),
seq as (select a.d + (10 * b.d) + (100 * c.d) + (1000 * d.d) as num
    from digit a cross join digit b cross join digit c cross join digit d order by 1        
)
select seq.num,0,2,10 from seq where seq.num<10000;
-- Source: http://www.silota.com/docs/recipes/mysql-sequential-generate-series-numbers-time.html

-- CUSTOMER
DROP TABLE customer CASCADE;
CREATE TABLE customer (id bigint NOT NULL, PRIMARY KEY (id));
    select 0 as d union all select 1 union all select 2 union all select 3 union all
    select 4 union all select 5 union all select 6 union all
    select 7 union all select 8 union all select 9        
), seq as (select a.d + (10 * b.d) + (100 * c.d) + (1000 * d.d) + (10000 * e.d) as num
    from digit a cross join digit b cross join digit c cross join digit d cross join digit e order by 1        
) select seq.num from seq where seq.num<100000;

-- ROUTE
DROP TABLE route CASCADE;
CREATE TABLE route (
    id bigint NOT NULL,
    status integer NOT NULL,
    cab_id bigint NOT NULL,
    PRIMARY KEY (id),
    FOREIGN KEY (cab_id) REFERENCES cab(id)
);

-- LEG
DROP TABLE leg CASCADE;
CREATE TABLE leg (
    id bigint NOT NULL,
    completed timestamp,
    distance integer NOT NULL,
    from_stand integer NOT NULL,
    place integer NOT NULL,
    started timestamp,
    status integer NOT NULL,
    reserve integer NOT NULL,
    passengers integer NOT NULL,
    to_stand integer NOT NULL,
    route_id bigint NOT NULL,
    PRIMARY KEY (id),
    FOREIGN KEY (route_id) REFERENCES route(id)
);

-- STAT
DROP TABLE stat CASCADE;
CREATE TABLE stat (
    name character varying(255) NOT NULL,
    int_val integer NOT NULL,
    PRIMARY KEY (name)
);

-- STOP
DROP TABLE stop CASCADE;
CREATE TABLE stop (
    id bigint NOT NULL,
    bearing integer,
    latitude double precision NOT NULL,
    longitude double precision NOT NULL,
    name character varying(255),
    no character varying(255),
    type character varying(255),
    PRIMARY KEY (id)
);
